import React from 'react';

const products = [
  {
    id: 1,
    name: 'Shadow Luxe Hoodie',
    price: '$89',
    image: 'https://source.unsplash.com/600x800/?hoodie,fashion',
  },
  {
    id: 2,
    name: 'Velvet Dawn Jacket',
    price: '$129',
    image: 'https://source.unsplash.com/600x800/?jacket,style',
  },
  {
    id: 3,
    name: 'Noir Essential Tee',
    price: '$39',
    image: 'https://source.unsplash.com/600x800/?tshirt,clothing',
  },
  {
    id: 4,
    name: 'Crisp White Joggers',
    price: '$69',
    image: 'https://source.unsplash.com/600x800/?joggers,clothes',
  },
];

const ProductList = () => {
  return (
    <div className="min-h-screen bg-white px-6 py-10">
      <h1 className="text-4xl font-extrabold text-center text-gray-900 mb-10">
        Discover the Drop
      </h1>
      <p className="text-center text-gray-600 max-w-xl mx-auto mb-12">
        Curated with edge, styled for distinction. Explore our newest arrivals crafted to elevate your streetwear game.
      </p>
      <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 lg:grid-cols-4 gap-8">
        {products.map(product => (
          <div
            key={product.id}
            className="bg-white shadow-md rounded-lg overflow-hidden hover:shadow-xl transition duration-300"
          >
            <img
              src={product.image}
              alt={product.name}
              className="w-full h-80 object-cover"
            />
            <div className="p-4">
              <h2 className="text-lg font-semibold text-gray-900">{product.name}</h2>
              <p className="text-gray-600 mt-1">{product.price}</p>
              <button className="mt-4 w-full bg-black text-white py-2 rounded hover:bg-gray-800 transition">
                Add to Cart
              </button>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default ProductList;
